pragma solidity ^0.4.19;

contract Baccarat {
	uint256 _seed;
    uint8 constant private CARD_TOTAL = 52;
	mapping(uint256 => Card[]) private cards; 

	event Shuffle();
    event Deal(
		uint256 indexed value, 
		uint256 protocol, 
		uint256 upper, 
		uint256 index
	);

	struct Card {
	    bytes1 status;
		uint256 value;
	}
	int[] internal data1;

	function shuffle(uint256 roomId) public {
		delete cards[roomId];

	    for(uint256 i=0; i<CARD_TOTAL; i++) {
			Card memory card;
			card.status = bytes1(0);
			card.value = i+1;
		    cards[roomId].push(card);	
		}
	}

	function maxRandom() public returns (uint256 randomNumber) {
	    _seed = uint256(keccak256(
		    _seed,
			block.blockhash(block.number - 1),
			now,
			block.coinbase,
			block.difficulty
		));
		return _seed;
	}

	function random(uint256 upper) public returns (uint256 randomNumber) {
	    return maxRandom() % upper;
	}

	function deal(uint256 roomId) public returns(uint256) {
		if(cards[roomId].length == 0) {
			Deal(0, 88, 0, 0);
			return;
		}
		var upper = cards[roomId].length;
        var index = random(upper)-1;
		var card  = cards[roomId][index];

		Deal(card.value, 99, upper, index);

		for(uint256 i=index; i<(upper-1); i++) {
	        cards[roomId][i] = cards[roomId][i+1];
		}
		delete cards[roomId][upper-1];
		cards[roomId].length--;

		return card.value; 
	}

    function set2(int[] x) public {
	    x[0] = 8;
	}

	function set(int[] storage x) internal  {
	    x.push(1);
	}

	function test() public {
	    data1.push(2);
	}

	function x() public {
		int[] memory f = new int[](1);
		f[0] = 8;
	    set(data1);
		test();
		set2(f);
		data1[0] = f[0];
	}

	function get() public returns(int[]) {
        return data1;	
	}

}
